import React from 'react';

const NavBar = ({ totalCounters }) => {
    return (
        <nav className="navbar navbar-light bg-light">
            <a className="navbar-brand">
                Players <span className="badge badge-pill badge-secondary mb-0 mr-4">{totalCounters.length}</span>
                Current winner <span className="badge badge-pill badge-secondary mb-0">{totalCounters.length}</span>
            </a>
        </nav>
    );
};

export default NavBar;
